Чем я могу вам помочь: 
- Полностью настроить и администрировать тренинги на платформах Getcourse, Bizon365; - Подключить домен и настроить доменную почту; 
- Подключить платежные системы; 
- Организовать проведение вебинаров; 
- Создать лендинг и настроить подписные страницы; - Настроить email-рассылки; 
- Настроить автоматические серии писем; 
- Создать и настроить чат-боты.
